import React, {useState, useEffect} from 'react';
import './App.css';
// import BookCard from './components/bookCard';

function App() {
  // eslint-disable-next-line
  const [books, setBooks] = useState([]);
  useEffect(() => {
    const booksJson = 'http://localhost:8888/api/books/books' ;
    async function fetchData() {
      setBooks(
        await fetch(booksJson)
        .then(res => res.json())
        .then(res => res.books)
      )
      console.log(books)
    }
    fetchData();
  },[]);
  return(
    <div className="App">
      <header>
        <h1>Hello World</h1>
        {books.map(book => book.id)}
      </header>
    </div>
  );
}

export default App;
